    private static Block registerBlock(String name, Block block) {
        registerBlockItem(name, block);
        return Registry.register(Registries.BLOCK, Identifier.of(VilinhaHauteCouture.MOD_ID, name), block);
    }

    private static void registerBlockItem(String name, Block block) {
        Registry.register(Registries.ITEM, Identifier.of(VilinhaHauteCouture.MOD_ID, name),
                new BlockItem(block, new Item.Settings()));
    }

    public static void registerModBlocks() {
        VilinhaHauteCouture.LOGGER.info("Registrando Custom Blocks para " + VilinhaHauteCouture.MOD_ID);
    }

